		ranks[2] = _table[0].rank;
		ranks[3] = _table[1].rank;
		ranks[4] = _table[2].rank;
		ranks[5] = _table[3].rank;
		ranks[6] = _table[4].rank;

		uint8[] memory allRankValues;		
		        
        for (uint i = 0; i < ranks.length; i++) {
            for (uint8 j = 0; j < rankOrder.length; j++) {
