		ranks[4] = _table[2].rank;
		ranks[5] = _table[3].rank;
		ranks[6] = _table[4].rank;
		
		uint256 pairCount = 0;
		string memory pairs = "";

		for (uint i = 0; i < ranks.length; i++) {
			for (uint j = i+1; j < ranks.length; j++) {
				if (keccak256(abi.encodePacked(ranks[i])) == keccak256(abi.encodePacked(ranks[j]))) {	
					pairCount += 1;

					if (pairCount == 1) {
						pairs = ranks[i];
					}

					else if (pairCount == 2 && keccak256(abi.encodePacked(pairs)) == keccak256(abi.encodePacked(ranks[j]))) {
						pairCount -= 1;
					}
				}
			}
		}

		if (pairCount >= 2) {
			return true;
		}

		return false;
	}


